import React, { Component } from "react";

class Content extends Component {
    render() {
        var lists = [];
        var data = this.props.data;
        var i = 0;
        while(i<data.length){
            lists.push(
                <li key={data[i].id}>
                            <a 
                                href={data[i].id}>{data[i].title}
                            </a>
                        </li>);
            i += 1;
        }

        return (
            <nav>
                <ul>
                    {lists}
                </ul>
            </nav>
        )
    }
}

export default Content;
